INSERT INTO `learning_styles` (`id`, `style_en`, `style_es`, `type`, `info_en`, `info_es`, `image`, `description_en`, `description_es`, `created_at`, `updated_at`) VALUES
(1, 'Independent', 'Independiente', 'student', 'You like to think for yourself. You are autonomous and confident in your learning. You decide what is important and what is not, and you like to work alone. You avoid teamwork.', 'Te gusta pensar por ti mismo. Eres autónomo y confiado en tu aprendizaje. Decides lo que es importante y lo que no lo es, y te gusta trabajar de manera solitaria. Evitas el trabajo en equipo.', 'media/students/Independiente.png', 'I prefer to work alone and set my own pace of learning.', 'Prefiero trabajar solo y establecer mi propio ritmo de aprendizaje.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(2, 'Evitativo', 'Evitativo', 'student', 'You do not show enthusiasm in class. You do not participate and you keep yourself isolated. You are apathetic and uninterested in school activities. You don\'t like to spend a lot of time in the classroom.', 'No manifiestas entusiasmo en clase. No participas y te mantienes aislado. Eres apático y desinteresado en las actividades escolares. No te gusta estar mucho tiempo en el aula.', 'media/students/evitativo.png', 'I often avoid actively participating in the learning process.', 'A menudo evito participar activamente en el proceso de aprendizaje.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(3, 'Collaborative', 'Colaborativo', 'student', 'You like to learn by sharing ideas and talents. You like to work with your classmates and with your teachers.', 'Te gusta aprender compartiendo ideas y talentos. Gustas de trabajar con tus compañeros y con tus profesores.', 'media/students/colaborativo.png', 'I learn best by working with others and value teamwork and interaction.', 'Aprendo mejor trabajando con otros y valoro el trabajo en equipo y la interacción.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(4, 'Dependiente', 'Dependiente', 'student', 'You show little intellectual curiosity and learn only what you have to learn. You visualize teachers and your classmates as guiding or authoritative figures to carry out your activities.', 'Manifiestas poca curiosidad intelectual y aprendes solo lo que tienes que aprender. Visualizas a los profesores y a tus compañeros como figuras de guía o autoridad para realizar tus actividades.', 'media/students/dependiente.png', 'I look for a clear structure and specific guidelines.', 'Busco una estructura clara y directrices específicas.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(5, 'Competitive', 'Competitivo', 'student', 'You study to demonstrate your supremacy in terms of performance or grade. You like to be the center of attention and receive recognition for your achievements.', 'Estudias para demostrar tu supremacía en términos de aprovechamiento o calificación. Te gusta ser el centro de atención y recibir reconocimiento de tus logros.', 'media/students/competitivo.png', 'I want to be the best and learn to outperform others.', 'Quiero ser el mejor y aprender para superar a los demás.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(6, 'Participative', 'Participativo', 'student', 'You are a good element in class, you enjoy the session and try to be aware most of the time. You are very willing to do school work.', 'Eres un buen elemento en clase, disfrutas la sesión y procuras estar al pendiente la mayor parte del tiempo. Tienes mucha disposición para el trabajo escolar.', 'media/students/participativo.png', 'I seek to learn through direct and practical experiences.', 'Busco aprender a través de experiencias directas y prácticas.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(7, 'Expert', 'Experto', 'tutor', 'You are a tutor who possesses the knowledge and experience that students require. You maintain your status among your students because you master the details of the discipline you teach. In addition, you challenge your students through competition between them and you assume that your pupils need to be prepared by someone like you.', 'Eres tutor que posee el conocimiento y la experiencia que los estudiantes requieren. Mantienes tu estatus entre tus estudiantes porque dominas los detalles de la disciplina que impartes. Además, retas a tus estudiantes mediante la competencia entre ellos y partes del supuesto de que tus pupilos necesitan ser preparados por alguien como tú.', 'media/tutors/experto.png', 'As an expert, I am a reliable source of information and knowledge in my area.', 'Como experto, soy una fuente confiable de información y conocimiento en mi área.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(8, 'Formal Authority', 'Autoridad Formal', 'tutor', 'You refer to the tutor who maintains his status among the students for his knowledge and, of course, within the school. You offer effective feedback to students based on course objectives, your expectations and through institutional regulations. You take great care of the correct and acceptable regulations within the school and offer structured knowledge to your pupils.', 'Te refieres al tutor que mantiene su estatus entre los estudiantes por su conocimiento y, desde luego, dentro de la escuela. Ofreces retroalimentación eficaz a los estudiantes basada en los objetivos del curso, tus expectativas y mediante los reglamentos institucionales. Cuidas mucho la normatividad correcta y aceptable dentro de la escuela y ofreces un conocimiento estructurado a tus pupilos.', 'media/tutors/autoridad_formal.png', 'As a Formal Authority, I value structure and follow a detailed plan in my tutorials.', 'Como Autoridad Formal, valoro la estructura y sigo un plan detallado en mis tutorías.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(9, 'Personal Model', 'Modelo Personal', 'tutor', 'You are the tutor who believes to be the “example for your students” and that through your own performance you show them the appropriate ways to think and behave. You are meticulous and orderly, and through your person you motivate your pupils to emulate your own behavior.', 'Eres el tutor que cree ser el “ejemplo para tus estudiantes” y que por medio de tu propio desempeño les muestras a ellos las formas adecuadas para pensar y comportarse. Eres meticuloso y ordenado, y por medio de tu persona motivas a tus pupilos a emular tu propio comportamiento.', 'media/tutors/modelo_personal.png', 'As a personal tutor, I focus on the individual growth of each student.', 'Como tutor personal, me enfoco en el crecimiento individual de cada estudiante.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(10, 'Facilitator', 'Facilitador', 'tutor', 'You are the tutor who guides students towards learning through alternative questioning and decision making. You highlight the development of students with a view to independence, initiative and responsibility. You like to work through projects or problems that allow students to learn on their own and in which your role is only advisory.', 'Eres aquel tutor que guía a los estudiantes hacia el aprendizaje mediante cuestionamientos alternativos y toma de decisiones. Destacas el desarrollo de los estudiantes con miras a la independencia, la iniciativa y la responsabilidad. Gustas del trabajo por medio de proyectos o problemas que permiten a los estudiantes aprender por su cuenta y en los que tu función es solo de asesoría.', 'media/tutors/facilitador.png', 'As a facilitator, I guide my students towards discovery and autonomous learning.', 'Como facilitador, guío a mis estudiantes hacia el descubrimiento y aprendizaje autónomo.', '2023-08-20 19:43:52', '2023-08-20 19:43:52'),
(11, 'Delegator', 'Delegador', 'tutor', 'You are the tutor who gives the student freedom to be as autonomous as possible. You motivate students to work on projects independently or in small teams. You only serve as a project consultant.', 'Eres aquel tutor que le da libertad al alumno para ser lo más autónomo posible. Motivas a los estudiantes a trabajar en proyectos de manera independiente o en pequeños equipos. Funges solamente como consultor del proyecto.', 'media/tutors/delegador.png', 'As a delegator, I fully trust my students\' ability to direct their own learning.', 'Como delegador, confío plenamente en la capacidad de mis estudiantes para dirigir su propio aprendizaje.', '2023-08-20 19:43:52', '2023-08-20 19:43:52');
INSERT INTO `learning_style_characteristics` (`id`, `learning_style_id`, `characteristic_en`, `characteristic_es`, `created_at`, `updated_at`) VALUES
(1, 1, 'I value autonomy in learning.', 'Valoro la autonomía en el aprendizaje.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(2, 1, 'I like to discover for myself.', 'Me gusta descubrir por mí mismo.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(3, 1, 'I tend to be introspective.', 'Suelo ser introspectivo.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(4, 2, 'I can feel overwhelmed by challenges.', 'Puedo sentirme abrumado por los desafíos.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(5, 2, 'I often postpone tasks.', 'A menudo postergo las tareas.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(6, 2, 'I can be indifferent or disinterested.', 'Puedo ser indiferente o desinteresado.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(7, 3, 'I learn through interaction.', 'Aprendo a través de la interacción.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(8, 3, 'I value the opinions of others.', 'Valoro las opiniones de los demás.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(9, 3, 'I am a good listener.', 'Soy un buen oyente.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(10, 4, 'I need clear instructions.', 'Necesito instrucciones claras.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(11, 4, 'I seek the approval of the tutors.', 'Busco la aprobación de los tutores.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(12, 4, 'I can be passive in my learning.', 'Puedo ser pasivo en mi aprendizaje.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(13, 5, 'I am achievement oriented.', 'Estoy orientado a logros.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(14, 5, 'I seek recognition.', 'Busco reconocimiento.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(15, 5, 'I can be argumentative.', 'Puedo ser argumentativo.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(16, 6, 'I learn by doing.', 'Aprendo haciendo.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(17, 6, 'I seek to apply what I have learned.', 'Busco aplicar lo aprendido.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(18, 6, 'I am active and dynamic.', 'Soy activo y dinámico.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(19, 7, 'I have answers to my students\' questions and doubts.', 'Tengo respuestas a las preguntas y dudas de mis estudiantes.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(20, 7, 'I strive to convey my knowledge in a clear and concise manner.', 'Me esfuerzo por transmitir mi conocimiento de manera clara y concisa.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(21, 8, 'I always follow a pre-established agenda or plan.', 'Siempre sigo un temario o plan preestablecido.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(22, 8, 'I make sure that each session is well organized and structured.', 'Me aseguro de que cada sesión esté bien organizada y estructurada.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(23, 9, 'I value and consider the experiences and feelings of my students.', 'Valoro y considero las experiencias y sentimientos de mis estudiantes.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(24, 9, 'I seek that each one develops their personal and academic skills.', 'Busco que cada uno desarrolle sus habilidades personales y académicas.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(25, 10, 'I help students find their own answers.', 'Ayudo a los estudiantes a encontrar sus propias respuestas.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(26, 10, 'I am there to guide them, not to give them all the answers.', 'Estoy allí para guiarlos, no para darles todas las respuestas.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(27, 11, 'I delegate responsibilities and tasks to students.', 'Delego responsabilidades y tareas a los estudiantes.', '2023-08-20 19:44:05', '2023-08-20 19:44:05'),
(28, 11, 'I believe in the autonomy and ability of each one.', 'Creo en la autonomía y capacidad de cada uno.', '2023-08-20 19:44:05', '2023-08-20 19:44:05');
INSERT INTO `learning_style_recommended_techniques` (`id`, `learning_style_id`, `technique_en`, `technique_es`, `created_at`, `updated_at`) VALUES
(1, 1, 'I value autonomy in learning', 'Valoro la autonomía en el aprendizaje', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(2, 1, 'I like to discover for myself.', 'Me gusta descubrir por mí mismo.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(3, 1, 'I tend to be introspective.', 'Suelo ser introspectivo.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(4, 2, 'I can feel overwhelmed by challenges.', 'Puedo sentirme abrumado por los desafíos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(5, 2, 'I often postpone tasks.', 'A menudo postergo las tareas.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(6, 2, 'I can be indifferent or disinterested.', 'Puedo ser indiferente o desinteresado.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(7, 3, 'I form study groups.', 'Formo grupos de estudio.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(8, 3, 'I hold discussions and debates on topics.', 'Realizo discusiones y debates sobre temas.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(9, 3, 'I share and compare notes with classmates.', 'Comparto y comparo notas con compañeros.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(10, 4, 'I need clear instructions.', 'Necesito instrucciones claras.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(11, 4, 'I seek the approval of the tutors.', 'Busco la aprobación de los tutores.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(12, 4, 'I can be passive in my learning.', 'Puedo ser pasivo en mi aprendizaje.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(13, 5, 'I set clear goals for each study session.', 'Establezco metas claras para cada sesión de estudio.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(14, 5, 'I use memory cards or flashcards to review.', 'Uso tarjetas de memoria o flashcards para repasar.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(15, 5, 'I do exam drills to assess my progress.', 'Realizo simulacros de exámenes para evaluar mi progreso.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(16, 6, 'I do practical exercises or simulations.', 'Realizo ejercicios prácticos o simulaciones.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(17, 6, 'I relate the content to real situations.', 'Relaciono el contenido con situaciones reales.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(18, 6, 'I use experiential learning techniques, such as project-based learning.', 'Uso técnicas de aprendizaje experiencial, como el aprendizaje basado en proyectos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(19, 7, 'I organize sessions where students can ask me questions directly.', 'Organizo sesiones donde los estudiantes pueden hacerme preguntas directamente.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(20, 7, 'I give mini-lectures to address specific topics.', 'Realizo mini-conferencias para abordar temas específicos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(21, 7, 'I provide additional readings and resources for students to delve into.', 'Proporciono lecturas y recursos adicionales para que los estudiantes profundicen.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(22, 8, 'I use outlines or study guides to keep everyone on the same page.', 'Uso esquemas o guías de estudio para mantener a todos en la misma página.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(23, 8, 'I do group tests or quizzes to assess progress.', 'Realizo pruebas o cuestionarios grupales para evaluar el progreso.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(24, 8, 'I keep a structured track of the topics we address.', 'Mantengo un seguimiento estructurado de los temas que abordamos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(25, 9, 'I encourage open discussions where each student can share.', 'Fomento discusiones abiertas donde cada estudiante pueda compartir.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(26, 9, 'I propose self-assessment and reflection activities.', 'Propongo actividades de autoevaluación y reflexión.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(27, 9, 'I do group dynamics for everyone to share and learn together.', 'Realizo dinámicas de grupo para que todos compartan y aprendan juntos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(28, 10, 'I propose case studies for them to discuss and analyze in groups.', 'Propongo estudios de caso para que los discutan y analicen en grupo.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(29, 10, 'I encourage collaborative research projects.', 'Fomento proyectos de investigación colaborativos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(30, 10, 'I use problem-based learning for them to seek solutions together.', 'Utilizo el aprendizaje basado en problemas para que busquen soluciones juntos.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(31, 11, 'I assign specific roles to each group member.', 'Asigno roles específicos a cada miembro del grupo.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(32, 11, 'I propose projects in which they decide the focus and results.', 'Propongo proyectos en los que ellos decidan el enfoque y resultados.', '2023-08-20 19:44:14', '2023-08-20 19:44:14'),
(33, 11, 'I encourage group presentations where each one contributes from their perspective.', 'Fomento presentaciones grupales donde cada uno aporte desde su perspectiva.', '2023-08-20 19:44:14', '2023-08-20 19:44:14');
