INSERT INTO `questions` (`id`, `question_es`, `question_en`, `learning_style_id`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Tengo confianza en mi habilidad de aprender material importante del curso.', 'I am confident in my ability to learn important material from the course.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(2, 'A menudo me encuentro soñando despierto (a) durante clases.', 'I often find myself daydreaming during classes.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(3, 'Me gusta mucho trabajar con otros estudiantes en clases.', 'I really enjoy working with other students in class.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(4, 'El material del curso tiene información válida y veraz.', 'The course material has valid and accurate information.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(5, 'Me parece necesario competir con otros estudiantes por la atención del profesor y resolver mis dudas antes que los demás.', 'I feel the need to compete with other students for the teacher\'s attention and to get my questions answered before others.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(6, 'Usualmente estoy dispuesto a aprender sobre el contenido dado en clase.', 'I am usually willing to learn about the content taught in class.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(7, 'Mis pensamientos sobre el contenido usualmente son tan buenos como los que aparecen en el material.', 'My thoughts about the content are usually as good as those presented in the material.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(8, 'Las actividades en el salón de clases me parecen aburridas.', 'Classroom activities seem boring to me.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(9, 'Disfruto discutir ideas sobre el material de la clase con otros estudiantes.', 'I enjoy discussing ideas about the class material with other students.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(10, 'Considero que los profesores saben exactamente lo que es importante aprender en un curso.', 'I believe that teachers know exactly what is important to learn in a course.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(11, 'Siento que es necesario competir con otros estudiantes por la mejor nota.', 'I feel it is necessary to compete with other students for the best grade.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(12, 'Siento que vale la pena atender las sesiones de clases presenciales.', 'I feel that attending in-person class sessions is worth it.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(13, 'Yo estudio lo que es importante para mí y no siempre lo que el profesor diga que es importante.', 'I study what is important to me and not always what the teacher says is important.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(14, 'Muy raras veces me emociona el contenido explicado en clase.', 'Very rarely am I excited about the content explained in class.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(15, 'Disfruto escuchar lo que otros estudiantes piensan sobre los temas discutidos en el salón de clases.', 'I enjoy hearing what other students think about the topics discussed in the classroom.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(16, 'Los profesores deberían decir claramente lo que esperan de los estudiantes.', 'Teachers should clearly state what they expect from students.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(17, 'Cuando hay discusiones en clase, debo competir con los otros estudiantes para que mis ideas sean escuchadas.', 'When there are discussions in class, I must compete with other students to have my ideas heard.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(18, 'Aprendo más del curso en el aula de clases que en casa.', 'I learn more from the course in the classroom than at home.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(19, 'La mayoría de los temas explicados los aprendí por mi cuenta.', 'I learned most of the topics explained on my own.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(20, 'Generalmente siento que tengo que asistir a clases, aunque no quiera.', 'I generally feel like I have to attend classes, even if I don\'t want to.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(21, 'Pienso que los estudiantes pueden aprender más discutiendo sus ideas entre ellos.', 'I think students can learn more by discussing their ideas with each other.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(22, 'Intento hacer mis tareas siguiendo al pie de la letra las instrucciones del profesor.', 'I try to do my assignments by following the teacher\'s instructions to the letter.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(23, 'Los estudiantes deben volverse competitivos para tener un buen rendimiento en la escuela.', 'Students must become competitive to perform well in school.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(24, 'Los estudiantes tenemos la responsabilidad de sacarle el mayor provecho a las herramientas y recursos educativos que se nos dan en clases.', 'We students have the responsibility to make the most of the educational tools and resources given to us in class.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(25, 'Puedo identificar por mí mismo, los temas importantes del material de clases.', 'I can identify the important topics of class material on my own.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(26, 'Prestar atención durante una sesión de clases es difícil para mí.', 'Paying attention during a class session is difficult for me.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(27, 'Me gusta estudiar para exámenes con otros estudiantes.', 'I enjoy studying for exams with other students.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(28, 'Profesores que dejan que los estudiantes hagan lo que quieran, no están realizando su trabajo.', 'Teachers who let students do whatever they want are not doing their job.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(29, 'Me gusta obtener las respuestas de problemas o preguntas antes de que alguien más pueda.', 'I like to get answers to problems or questions before anyone else can.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(30, 'Las actividades del salón son generalmente interesantes.', 'Classroom activities are generally interesting.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(31, 'Me gusta desarrollar mis propias ideas sobre los temas dados en clases.', 'I like to develop my own ideas about the topics covered in class.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(32, 'Me he rendido de intentar aprender durante las clases presenciales.', 'I have given up trying to learn during in-person classes.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(33, 'Las ideas de otros estudiantes me ayudan a entender el material del curso.', 'The ideas of other students help me understand the course material.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(34, 'Los estudiantes deben ser supervisados por profesores en todos los proyectos del curso.', 'Students should be supervised by teachers in all course projects.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(35, 'Para estar un paso más adelante, es necesario pasar por encima de los demás estudiantes.', 'To get ahead, it is necessary to step over other students.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(36, 'Yo trato de participar lo más posible en todos los aspectos del curso.', 'I try to participate as much as possible in all aspects of the course.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(37, 'Tengo mis propias ideas de cómo las clases deberían ser presentadas.', 'I have my own ideas about how classes should be presented.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(38, 'En la mayoría de mis materias estudio solo lo suficiente para pasar.', 'In most of my subjects, I study just enough to pass.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(39, 'Una parte importante de tomar materias es aprender a convivir con otras personas.', 'An important part of taking courses is learning to get along with other people.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(40, 'Mis apuntes contienen casi todo lo que el profesor ha dicho en clases.', 'My notes contain almost everything the teacher has said in class.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(41, 'Los estudiantes pierden la oportunidad de una nota cuando comparten sus apuntes e ideas.', 'Students miss out on a grade when they share their notes and ideas.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(42, 'Completo las asignaciones de la materia sin importar si me parecen interesantes o no.', 'I complete assignments for the course regardless of whether they seem interesting to me or not.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(43, 'Si me gusta un tema, usualmente investigo por mi cuenta.', 'If I like a topic, I usually research on my own.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(44, 'Normalmente estudio intensamente antes de los exámenes.', 'I usually study intensively before exams.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(45, 'Aprender debería ser un esfuerzo cooperativo entre los estudiantes y la escuela.', 'Learning should be a cooperative effort between students and the school.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(46, 'Prefiero sesiones de clases que estén altamente organizadas.', 'I prefer class sessions that are highly organized.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(47, 'Para sobresalir en clases, trato de hacer las asignaciones mejor que los demás estudiantes.', 'To excel in classes, I try to do assignments better than other students.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(48, 'Yo completo las asignaciones apenas son entregadas.', 'I complete assignments as soon as they are handed out.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(49, 'Yo prefiero trabajar en proyectos relacionados con las clases (Estudiar para exámenes, hacer tareas, étc.) por mi cuenta.', 'I prefer to work on class-related projects (studying for exams, doing assignments, etc.) on my own.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(50, 'Me gustaría que los profesores me ignoraran en clases.', 'I would like teachers to ignore me in class.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(51, 'Dejo que los otros estudiantes tomen prestados mis apuntes cuando los piden.', 'I let other students borrow my notes when they ask for them.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(52, 'Los profesores deberían decirles a los estudiantes exactamente qué material se va a cubrir en un examen.', 'Teachers should tell students exactly what material will be covered on an exam.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(53, 'Me gusta saber el rendimiento de los otros estudiantes en las asignaciones y exámenes.', 'I like to know the performance of other students on assignments and exams.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(54, 'Yo completo las asignaciones que son para nota, tanto como las que son opcionales.', 'I complete assignments that are for credit, as well as optional ones.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(55, 'Cuando no entiendo algo, trato de averiguar por mi cuenta antes de buscar ayuda.', 'When I don\'t understand something, I try to figure it out on my own before seeking help.', 1, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(56, 'Durante clases, tiendo a hablar o bromear con las personas que están cerca de mí.', 'During classes, I tend to talk or joke with people who are near me.', 2, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(57, 'Participar en grupos pequeños de clases es algo que disfruto.', 'Participating in small class groups is something I enjoy.', 3, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(58, 'Yo pienso que las anotaciones e indicaciones del profesor en el tablero son de mucha ayuda.', 'I think the teacher\'s notes and indications on the board are very helpful.', 4, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(59, 'Le pregunto a otros estudiantes en clases qué notas recibieron en los exámenes y asignaciones.', 'I ask other students in class what grades they got on exams and assignments.', 5, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(60, 'En mis clases usualmente me siento en los puestos que están más adelante en el salón.', 'In my classes, I usually sit in the front seats of the classroom.', 6, 'student', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(61, 'Hechos, conceptos y principios son las cosas más importantes que los estudiantes deben adquirir.', 'Facts, concepts, and principles are the most important things students need to acquire.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(62, 'Establezco estándares altos para los estudiantes en esta clase.', 'I set high standards for students in this class.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(63, 'Lo que digo y hago modela formas apropiadas para que los estudiantes piensen sobre los temas del contenido.', 'What I say and do models appropriate ways for students to think about content topics.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(64, 'Mis objetivos y métodos de enseñanza abordan una variedad de estilos de aprendizaje de los estudiantes.', 'My teaching goals and methods address a variety of students\' learning styles.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(65, 'Los estudiantes suelen trabajar solos en los proyectos del curso con poca supervisión por mi parte.', 'Students often work alone on course projects with little supervision from me.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(66, 'Compartir mi conocimiento y experiencia con los estudiantes es muy importante para mí.', 'Sharing my knowledge and experience with students is very important to me.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(67, 'Doy retroalimentación negativa a los estudiantes cuando su desempeño no es satisfactorio.', 'I give negative feedback to students when their performance is unsatisfactory.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(68, 'Las actividades en esta clase alientan a los estudiantes a desarrollar sus ideas sobre temas de contenido.', 'Activities in this class encourage students to develop their ideas about content topics.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(69, 'Dedico tiempo a consultar con los estudiantes sobre cómo mejorar su trabajo en proyectos individuales y grupales.', 'I spend time consulting with students on how to improve their work on individual and group projects.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(70, 'Las actividades en esta clase alientan a los estudiantes a desarrollar sus ideas sobre temas de contenido.', 'Activities in this class encourage students to develop their ideas about content topics.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(71, 'Lo que tengo que decir sobre un tema es esencial para que los estudiantes adquieran una perspectiva más amplia sobre los problemas de esa área.', 'What I have to say about a topic is essential for students to gain a broader perspective on issues in that area.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(72, 'Los estudiantes describirían mis estándares y expectativas como algo estrictos y rígidos.', 'Students would describe my standards and expectations as strict and rigid.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(73, 'Normalmente muestro a los estudiantes cómo y qué hacer para dominar el contenido del curso.', 'I usually show students how and what to do to master the course content.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(74, 'Las discusiones en grupos pequeños ayudan a los estudiantes a desarrollar su capacidad de pensar críticamente.', 'Small group discussions help students develop their critical thinking skills.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(75, 'Los estudiantes diseñan una de las experiencias de aprendizaje más autodirigidas.', 'Students design one of the most self-directed learning experiences.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(76, 'Quiero que los estudiantes dejen este curso bien preparado para seguir trabajando en esta área.', 'I want students to leave this course well-prepared to continue working in this area.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(77, 'Soy responsable de definir lo que los estudiantes deben aprender y cómo deben aprenderlo.', 'I am responsible for defining what students need to learn and how they should learn it.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(78, 'Los ejemplos de mis experiencias personales a menudo ilustran puntos sobre el material.', 'Examples from my personal experiences often illustrate points about the material.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(79, 'Guío el trabajo de los estudiantes en los proyectos del curso haciéndoles preguntas, explorando opciones y sugiriendo formas alternativas.', 'I guide students\' work on course projects by asking questions, exploring options, and suggesting alternative ways.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(80, 'Desarrollar la capacidad de los estudiantes para pensar y trabajar de forma independiente es un objetivo importante.', 'Developing students\' ability to think and work independently is an important goal.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(81, 'Dar conferencias es una parte importante de cómo enseño cada sesión de clase.', 'Lecturing is an important part of how I teach each class session.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(82, 'Proporciono pautas obvias sobre cómo quiero que se completen las tareas en este curso.', 'I provide clear guidelines on how I want tasks to be completed in this course.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(83, 'A menudo muestro a los estudiantes cómo pueden usar varios principios y conceptos.', 'I often show students how they can apply various principles and concepts.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(84, 'Las actividades del curso alientan a los estudiantes a tomar la iniciativa y la responsabilidad de su aprendizaje.', 'Course activities encourage students to take initiative and responsibility for their learning.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(85, 'Los estudiantes asumen la responsabilidad de impartir parte de las sesiones de clase.', 'Students take responsibility for leading part of the class sessions.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(86, 'Mi experiencia generalmente se usa para resolver desacuerdos sobre problemas de contenido.', 'My experience is often used to resolve disagreements about content issues.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(87, 'Este curso tiene metas y objetivos concretos que quiero lograr.', 'This course has specific goals and objectives I want to achieve.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(88, 'Los estudiantes reciben frecuentes comentarios verbales y escritos sobre su desempeño.', 'Students receive frequent verbal and written feedback on their performance.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(89, 'Solicito el consejo de los estudiantes sobre cómo y qué enseñar en este curso.', 'I seek advice from students on how and what to teach in this course.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(90, 'Los estudiantes establecen su propio ritmo para completar proyectos independientes y grupales.', 'Students set their own pace to complete independent and group projects.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(91, 'Los estudiantes pueden describirme como un \'almacén de conocimiento\' que proporciona los hechos, principios y conceptos que necesitan.', 'Students can describe me as a \'storehouse of knowledge\' providing the facts, principles, and concepts they need.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(92, 'El plan de estudios define claramente mis expectativas sobre lo que quiero que hagan los estudiantes en esta clase.', 'The curriculum clearly defines my expectations for what I want students to do in this class.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(93, 'Eventualmente, muchos estudiantes comenzaron a pensar como yo sobre el contenido del curso.', 'Eventually, many students started thinking like me about the course content.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(94, 'Los estudiantes pueden elegir entre actividades para completar los requisitos del curso.', 'Students can choose among activities to complete course requirements.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(95, 'Mi enfoque de la enseñanza es similar al de un gerente de un grupo de trabajo que delega tareas y responsabilidades a sus subordinados.', 'My teaching approach is similar to that of a manager of a workgroup who delegates tasks and responsibilities to subordinates.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(96, 'Este curso tiene más material del que tengo tiempo disponible para cubrir.', 'This course has more material than I have time available to cover.', 7, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(97, 'Mis estándares y expectativas ayudan a los estudiantes a desarrollar la disciplina que necesitan aprender.', 'My standards and expectations help students develop the discipline they need to learn.', 8, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(98, 'Los estudiantes pueden describirme como un \'entrenador\' que trabaja en estrecha colaboración con alguien para corregir problemas en su forma de pensar y comportarse.', 'Students can describe me as a \'coach\' who works closely with someone to correct issues in their way of thinking and behaving.', 9, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(99, 'Doy a los estudiantes mucho apoyo personal y aliento para que les vaya bien en este curso.', 'I give students a lot of personal support and encouragement to do well in this course.', 10, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19'),
(100, 'Asumo el papel de una persona de recursos disponible para los estudiantes cuando necesitan ayuda.', 'I assume the role of a resource person available to students when they need help.', 11, 'tutor', '2023-08-13 21:27:19', '2023-08-13 21:27:19');
